p>asdf asdf</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(33,2026,'','*|FNAME|* there is a message for you...','<p>Hi *|FNAME|*,</p>\r\n<p>Just ignore.this is for checking from talentpool. We are coming shortly!</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(34,2026,'','*|FNAME|* there is a message for you...','<p>hI *|FNAME|*</p>\r\n<p>tHIS IS FOR CHECKING</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(35,2024,'','*|FNAME|* there is a message for you...','<p>asdf sdfa</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(36,2022,'','*|FNAME|* there is a message for you...','<p>Test text.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Tom</p>\r\n<p>TalentPool</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(37,2022,'','*|FNAME|* there is a message for you...','<p>Test.&nbsp;</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(38,2024,'','*|FNAME|* there is a message for you...','<p>asdf asdfCheck</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(39,2031,'','*|FNAME|* there is a message for you...','<p>Sample text.</p>\r\n<p>Please note, this is just an example.</p>\r\n<p>Signoff,</p>\r\n<p>Individual</p>\r\n<p>Position</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(40,2036,'','*|FNAME|* there is a message for you...','<p>Hi,&nbsp;</p>\r\n<p>My name is Daniel. I am the regional manager of Deliveroo North West.</p>\r\n<p>Deliveroo is a technology company focused on marketing, selling and delivering high-quality restaurant food to homes and offices.</p>\r\n<p>We work with hundreds of the UK\'s best loved restaurants, including names like Carluccio\'s, GBK, Nando\'s, Gaucho&nbsp;and many top quality independents. &nbsp;Many large and prestigious firms already rely on Deliveroo for their food needs.</p>\r\n<p>Our technology platform optimizes food ordering and delivery by integrating web and mobile consumers with restaurant tablet-based point-of-sale order management terminals and our logistics optimization algorithm via our delivery driver smartphone software.</p>\r\n<p>We are currently undergoing a UK wide expansion. Our first regional hub is the North West and I need some young, smart and motivated people to join my team. This is a great industry to get involved in and a great time to get involved in it. We have just closed our series B&nbsp;($25 mil) and are in rapid growth phase. Deliveroo is going&nbsp;places and I want people to help me get there and to learn and be rewarded in the process.</p>\r\n<p>If you are interested in coming on board (either in the role below or if you would like to discuss what other opportunities we have), please do get in touch directly - <a href=\"mailto:dan@deliveroo.co.uk\">dan@deliveroo.co.uk</a>. It would be great if you could include a brief introductory note and attach your CV to get things moving. And please make the subject bar &lsquo;TalentPool Role Response&rsquo; so I can pick your email out easily.</p>\r\n<p>I look forward to hearing from you!</p>\r\n<p class=\"p1\"><br /> Dan</p>\r\n<p class=\"p1\">&nbsp;</p>\r\n<p class=\"p1\">&nbsp;</p>\r\n<p class=\"p1\"><strong>Role Title: Driver Operations Manager</strong><br /> <strong>Location:</strong> Manchester<br /> <strong>Salary:</strong> &pound;25-30k base<br /> <strong>Start Date:</strong> ASAP<br /> <br /> <strong>Role Description</strong></p>\r\n<div class=\"description-section\" style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: Helvetica, Arial, sans-serif; vertical-align: baseline; font-stretch: inherit; line-height: 16px;\">\r\n<div class=\"rich-text\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-size: 13px; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: 17px; color: #333333;\">\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">Deliveroo&rsquo;s Driver Operations team deal with management of our driver team, the face and wheels of Deliveroo. You will be working to become the Manchester Driver Operations Manager in order to help expand the business. Your tasks will include four key pillars, driver scheduling, driver performance, driver recruitment and driver payments.</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">- Management of a fleet of +50 drivers</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">- Performance management through driver data analysis to identify those drivers who perform strongly and those who need re-training or further encouragement. Freedom to create driver reward schemes which drive performance across the fleet</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">- Scheduling drivers via a web-based scheduling portal; ensuring current staffing targets are met and ensuring we have appropriate drivers for both trough and peak traffic</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">- Discipline, driver disputes, and behaviour management across a wide range of cultures, religions and backgrounds</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">- Supervision of driver payments; equipment deposits; tip &amp; reward payments</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; font-variant: inherit; font-stretch: inherit; line-height: inherit;\">- Research into new Deliveroo zones for driver hiring; approaching community leaders and venues in order to advertise driver recruitment</p>\r\n</div>\r\n</div>\r\n<div class=\"skills-section\" style=\"margin: 20px 0px 0px; padding: 20px 0px 0px; border-width: 1px 0px 0px; border-top-style: solid; border-top-color: #cccccc; font-size: 16px; font-family: Helvetica, Arial, sans-serif; vertical-align: baseline; font-stretch: inherit; line-height: 16px;\">&nbsp;</div>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(41,2032,'','*|FNAME|* there is a message for you...','<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\"><span style=\"font-size: 15px; font-family: Quicksand; color: #666666; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Here at <a href=\"http://www.lmarks.com/\">L Marks</a>, we create and run accelerator programmes to help large corporates benefit from talented, fast-growing startups.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\"><span style=\"font-size: 15px; font-family: Quicksand; color: #666666; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Corporates often find it difficult to innovate from within. Even though their employees are experienced and full of great ideas, the demands of day-to-day operations get in the way. Our accelerators solve this problem.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\"><span style=\"font-size: 15px; font-family: Quicksand; color: #666666; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We spend time with our corporate partners understanding their innovation needs. We find startups that can cater to those needs and then we help both parties work together to implement new products and services.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\"><span style=\"font-size: 15px; font-family: Quicksand; color: #666666; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We are behind <a href=\"http://jlab.co.uk/\">JLAB</a> (John Lewis) and <a href=\"http://www.lmarks.com/lastmilelabs\">Last Mile Labs</a> (DPD). With more programmes to come this year, we&rsquo;re getting busier by the day, so </span><span style=\"font-size: 15px; font-family: Quicksand; color: #666666; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">we\'re looking for someone special to join our team as Community Manager. </span></p>\r\n<p><span style=\"font-family: Quicksand; color: #666666; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">This job is about representing us and our corporate partners to all those involved in the accelerators: participants, guest speakers, mentors etc. </span></p>\r\n<p><span style=\"font-family: Quicksand; color: #666666; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">You\'ll be paid &pound;10 per hour. We\'re looking for someone to join the team for 6 months, but if you\'re right for the role there\'s every chance you could progress to become a permanent member of the L Marks team. </span></p>\r\n<p><span style=\"font-family: Quicksand; color: #666666; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">For more information, and to apply please send us a short intorduction and CV to: jobs@lmarks.com. </span></p>\r\n<p><span style=\"font-family: Quicksand; color: #666666; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">Best Wishes, </span></p>\r\n<p><span style=\"font-family: Quicksand; color: #666666; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">Team L Marks.</span></p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(42,2039,'','*|FNAME|* there is a message for you...','<p>Hi there,</p>\r\n<p>This is a test</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(43,2054,'','*|FNAME|* there is a message for you...','<p>Hello,</p>\r\n<p>Will you work for me?</p>\r\n<p>Please?</p>\r\n<p>Jonny</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(44,2040,'','*|FNAME|* there is a message for you...','<p>Shared Intelligence is a strong team of experienced proffessionals with the ambition and confidence to help our clients address their most pressing challenges.</p>\r\n<p>We are recruiting a Project Administrator and can see you match what we are looking for in terms of skill and ability.&nbsp; We would love to hear from you if this is an opportunity you would be interested in.&nbsp; You can find out more from the job specification on our website.</p>\r\n<p>The closing date is Thursday 12th February.&nbsp; Please send a covering letter and CV to Margaret.Brade@sharedintelligence.net</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(45,2022,'','*|FNAME|* there is a message for you...','<p>Test message for back button</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(46,2022,'','*|FNAME|* there is a message for you...','<p>Text text text&nbsp;</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(47,2061,'','*|FNAME|* there is a message for you...','<p>Xxxx</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(48,2066,'','*|FNAME|* there is a message for you...','<p>I\'m interested in your profile.</p>\r\n<p>Get in touch.</p>\r\n<p>DB</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(49,2037,'','*|FNAME|* there is a message for you...','<p>test</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(50,2092,'','*|FNAME|* there is a message for you...','<p>Hi,</p>\r\n<p>Want to work for me?</p>\r\n<p>Cheers,</p>\r\n<p>&nbsp;</p>\r\n<p>Dan</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(51,2093,'','*|FNAME|* there is a message for you...','<p><span style=\"color: black; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; font-size: 10pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB; mso-bidi-language: AR-SA;\">We are currently recruiting for a Digital Marketing Executive to join a growing team. This is an entry level role and an excellent opportunity to develop both digital and offline marketing skills and experience in a growing professional services organisation.&nbsp;The role holder will provide support to the Marketing Manager in the execution, delivery and reporting of marketing activity across the organisation&rsquo;s 8 global offices. <br /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"line-height: 115%; font-family: \'Arial\',\'sans-serif\'; font-size: 11pt; mso-fareast-font-family: Calibri; mso-ansi-language: EN-GB; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><strong><span style=\"color: #000000;\">Location: Soho, London </span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"color: #000000;\">Salary: &pound;20-25,000 per annum </span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #000000;\"></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: black; font-family: \'Arial\',\'sans-serif\'; font-size: 10pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">This role would be ideally suited to a junior digital marketer/ recent graduate with some work experience who wants to develop a career in digital marketing.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>You must have proven experience and <strong style=\"mso-bidi-font-weight: normal;\">interest</strong> in social media and the wider digital landscape. Interviews will be taking place over the next 2 weeks with the right candidate to start as soon as possible. To apply email your CV to <a href=\"mailto:sbeaumont@firstpointgroup.com\">sbeaumont@firstpointgroup.com </a></p>\r\n<p>Many thanks<br /><strong>Stephanie Beaumont</strong><br /><strong>Marketing Manager - First Point Group</strong> <br /><br /></p>\r\n<p><span style=\"color: #000000;\"></span></p>\r\n<p><strong>Who we are</strong><span style=\"color: red; font-family: \'Arial\',\'sans-serif\'; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\"><br style=\"mso-special-character: line-break;\" /></span></p>\r\n<p>First Point Group (FPG) is a global Telecoms recruitment consultancy. Established in 2004, our network of 8 offices, located worldwide, now work with a wide range of businesses, from the world&rsquo;s largest Telecoms vendors, through to emerging suppliers to the industry. Over the years we\'ve gained deep industry expertise and experience, worked with companies in over 147 countries and developed close relationships with a vast network of telecoms professionals&rsquo;. <a href=\"http://www.firstpointgroup.com\"><strong>www.firstpointgroup.com</strong></a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(52,3023,'','*|FNAME|* there is a message for you...','<p>We are currently recruiting for a position in our financial recruitment business and believe that you have the relevant skills to assist with the rapid growth that we expect to undertake. We need an individual who has experience in building professional looking websites, to showcase our professional edge and to differentiate ourselves from the competition. If you are&nbsp;confident, self motivated, good at research and able to think out of the box so much the better.</p>\r\n<p>You will be responsible for supporting the Managing Director in researching both candidates and clients, calling and emailing. In addition, good English skills and the ability to blog and tweet effective content would be a plus. You may also be&nbsp;required to develop and give presentations.&nbsp;</p>\r\n<p>This is a paid and exciting opportunity to join a rapid growth business at the ground level, to grow with it and accordingly to reap the commensurate rewards. Based in Covent Garden.&nbsp;</p>\r\n<p>Best regards</p>\r\n<p>Neil&nbsp;</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(53,3024,'','*|FNAME|* there is a message for you...','<p>I am Steven Landsborough, Managing Director at Saleslogic, a small but ambitous sales recruitment agency in London. We work with a mixture of well established and start-up organisations within the software, digital marketing, ecommerce and IT space, helping them find top sales talent at the higher end of the market.&nbsp;</p>\r\n<p>Currently we are looking for 4 graduate recruitment consultants to join our expanding team and think you could be a great match. We provide excellent training, combining one on one, classroom, and on the job training that will give you the best start in what is a challenging but highly rewarding career. We have an excellent commission structure, and a clearly defined career path that can see you quickly progress through the hierarchy. One graduate last year had 3 promotions and earned &pound;52K in his first year and is now working towards a target that will see him grow and manage a team.&nbsp;</p>\r\n<p>Package: Basic salary is &pound;18K, which increases to &pound;20K after 3 month probation. Realistic OTE in yr1 is &pound;35-40K.</p>\r\n<p>I have a start date provisioned for 23rd February, but I am open to either extending this date to 2nd March or creating a 2nd start date in late March.&nbsp;</p>\r\n<p>If you like the sound of what I have written, and would like to explore it further, please send your cv to sl@saleslogic.co.uk and I will respond with 24 hours to arrange a time to speak with you.</p>\r\n<p>Kind regards</p>\r\n<p>Steven</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(54,2032,'','*|FNAME|* there is a message for you...','<p>Hi there!</p>\r\n<p><span style=\"font-family: Oxygen; white-space: pre-wrap; line-height: 1.38; background-color: transparent;\">We\'re L Marks. W</span><span style=\"font-family: Oxygen; white-space: pre-wrap; line-height: 1.38; background-color: transparent;\">e create and run \'accelerator\' programmes to help large corporates benefit from talented, fast-growing startups. If you don\'t know what that means, check us out at lmarks.com. What we do is pretty cool and interesting. If you\'re a sharp cookie, then you might just be a good fit for our team. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We&rsquo;re at the beginning of an exciting mission to develop the \'science of corporate innovation\' and we&rsquo;re currently looking for a talented hustler to provide our Chairman with sales support. </span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">If you were to join our team, your role would be to identify corporates that could benefit from our services, research them thoroughly, find key senior contacts and arrange meetings with them. Before meetings with prospective clients, you would brief our Chairman and prepare sales materials and proposals. Finally, you would attend sales meetings with our Chairman and help close new business! </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\">We\'re a small team and we keep it pretty casual at the office. We pay between &pound;23,000 and &pound;30,000 per year + commission on any deals that you help close.</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\">If this sounds like your bag, then drop us a line: jobs@lmarks.com</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\">Best wishes,</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\">The L Marks Team</p>\r\n<p><span style=\"font-family: Oxygen; white-space: pre-wrap; line-height: 1.38; background-color: transparent;\">&nbsp;</span></p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(55,2032,'','*|FNAME|* there is a message for you...','<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 11pt; margin-bottom: 11pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Hi *|FNAME|*!</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 11pt; margin-bottom: 11pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We\'re L Marks. We create and run \'accelerator\' programmes to help large corporates benefit from talented, fast-growing startups. If you don\'t know what that means, check us out at lmarks.com. What we do is pretty cool and interesting. If you\'re a sharp cookie, then you might just be a good fit for our team.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We&rsquo;re at the beginning of an exciting mission to develop the \'science of corporate innovation\' and we&rsquo;re currently looking for a talented hustler to provide our Chairman with sales support</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">If you were to join our team, your role would be to identify corporates that could benefit from our services, research them thoroughly, find key senior contacts and arrange meetings with them. Before meetings with prospective clients, you would brief our Chairman and prepare sales materials and proposals. Finally, you would attend sales meetings with our Chairman and help close new business!</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We\'re a small team and we keep it pretty casual at the office. We pay between &pound;23,000 and &pound;30,000 per year + commission on any deals that you help close.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">If this sounds like your bag, we&rsquo;d love to hear from you. Drop us a line: jobs@lmarks.com</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 15px; font-family: Oxygen; color: #000000; background-color: #ffffff; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Best wishes,</span></p>\r\n<p><span id=\"docs-internal-guid-2618207c-786a-745b-a5b3-01423cc3f27b\"><span style=\"font-family: Oxygen; vertical-align: baseline; white-space: pre-wrap;\">The L Marks Team</span></span></p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(56,2092,'','*|FNAME|* there is a message for you...','<p>&nbsp;Test text.&nbsp;</p>',2,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(57,2031,'','*|FNAME|* there is a message for you...','<blockquote style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8000001907349px;\"><center>\r\n<table style=\"border-collapse: collapse; margin: 0px; padding: 0px; height: 1656px; width: 994px; background-color: #ecf2f7;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-family: arial, sans-serif; margin: 0px; padding: 20px; border-top-width: 0px; height: 1616px; width: 954px;\" align=\"center\" valign=\"top\">\r\n<table style=\"border-collapse: collapse; border: 0px;\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-family: arial, sans-serif; margin: 0px;\" align=\"center\" valign=\"top\">\r\n<table style=\"border-collapse: collapse; border-top-width: 0px; border-bottom-width: 0px; background-color: #ffffff;\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-family: arial, sans-serif; margin: 0px;\" valign=\"top\">\r\n<table style=\"border-collapse: collapse;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-family: arial, sans-serif; margin: 0px;\" valign=\"top\">\r\n<table style=\"border-collapse: collapse;\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-family: Helvetica; margin: 0px; padding: 9px 18px; color: #606060; font-size: 15px; line-height: 22.5px;\" valign=\"top\"><span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\"><span style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">Hi&nbsp;<span style=\"color: #696969;\">,</span><span class=\"im\"><br /><br />Seeing your details on TalentPool, we wanted to introduce ourselves as we think you could be a good fit with our business.<br /><br /></span>By way of background we are&nbsp;<a style=\"color: #1155cc;\" href=\"http://www.jukedeck.com/\" target=\"_blank\">Jukedeck</a>&nbsp;- a music technology startup. We\'ve built software that writes original music at the touch of a button. We won the&nbsp;<a style=\"color: #1155cc;\" href=\"http://blog.jukedeck.com/we-won-the-leweb-startup-competition/\" target=\"_blank\">LeWeb Startup Competition 2014</a>, are venture funded, and are currently based at TechHub, overlooking Silicon Roundabout.</span></p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">We\'re looking for a C++ Software Engineer with knowledge of music theory.&nbsp;Your responsibilities would&nbsp;include building generative music composition and production software via hands-on C++ development. Our ideal candidate will have an excellent understanding of the C++ 11 programming language and libraries (e.g. Boost) and an advanced (Grade 7+) understanding of music theory.</p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">In return we can provide the opportunity to build the world\'s first artificially intelligent music composition engine that creates usable&nbsp;music, significant learning opportunities, and ping pong</p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">If this sounds interesting, please email&nbsp;<a style=\"color: #1155cc;\" href=\"mailto:careers@jukedeck.com\" target=\"_blank\">careers@jukedeck.com</a>. We would be grateful if you could include a soft copy of your CV, a description of C++ work you\'re proud of and, if available, a link to or attachment containing code you\'ve written. A description of your music theory experience and links to any music you\'ve written or performed would also be appreciated.&nbsp;</p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\"><span class=\"im\" style=\"color: #500050;\">The position is based in Old Street, London, and the start date is ASAP.</span></p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"><span class=\"im\"></span></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">We look forward to hearing from you.</p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"><span class=\"im\"></span></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">&nbsp;</p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"><span class=\"im\"></span></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">Best wishes,</p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"><span class=\"im\"></span></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">&nbsp;</p>\r\n<span class=\"im\" style=\"color: #500050;\"><span class=\"im\" style=\"color: #500050;\"><span class=\"im\"></span></span></span>\r\n<p style=\"margin: 1em 0px; padding: 0px;\">Patrick</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</