  `hire_date` date NOT NULL,
  `emp_name` varchar(255) NOT NULL,
  `emp_sector` varchar(255) NOT NULL,
  `event_start_date` date NOT NULL,
  `event_end_date` date NOT NULL,
  `event_location` varchar(255) NOT NULL,
  `rsvp` varchar(255) NOT NULL,
  `opportunity_type` int(11) NOT NULL COMMENT '1-specific role,2-upcoming event,3-general intro',
  `opportunity_progress` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `employeer_id` (`employeer_id`),
  KEY `work_type_id` (`work_type_id`),
